import "./App.css";
import { createTheme, ThemeProvider } from "@material-ui/core";
const theme = createTheme({
    palette: {
        type: 'dark',
    },
    overrides: {
        MuiButtonBase: {
            root: {
                justifyContent: 'flex-start',
            },
        },
        MuiButton: {
            root: {
                textTransform: undefined,
                padding: '12px 16px',
            },
            startIcon: {
                marginRight: 8,
            },
            endIcon: {
                marginLeft: 8,
            },
        },
    },
});

const App = () => {

  return (
      <ThemeProvider theme={theme}>

      </ThemeProvider>
  );
};

export default App;
